import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  container: {
    background: "linear-gradient(45deg, #cbab89 30%, #b3b4af 90%)",
    padding: theme.spacing(8, 0, 6),
  },
  icon: {
    marginRight: "20px",
  },
  buttons: {
    marginTop: "40px",
  },
  toolbar: {
    background: "linear-gradient(45deg, #342b25 30%, #605b59 90%)",
  },
  buttonArtist: {
    color: "#342b25",
  },
  buttonCommunity: {
    color: "#605b59",
  },
}));

export default useStyles;
